import React from 'react'
import Dashboard from './Dashboard'

const App = () => {
  const dashStyle = {
    display: 'flex',
    alignItems: 'stretch',
    backgroundColor: 'red',
  }

  return (
    <div style={dashStyle}>
      <Dashboard />
    </div>
  )
}

export default App
